1) []string{&#34;foo&#34;} =&gt; []string{&ldquo;foo&rdquo;}
2) []string{&#34;foo\\nbar&#34;} =&gt; []string{&ldquo;foo\nbar&rdquo;} note: \n gets quoted with &ldquo;\&ldquo;
3) []string{&#34;false&#34;} =&gt; []string{&ldquo;false&rdquo;} note: that&rsquo;s a string &ldquo;false&rdquo; - which is a true value
4) []string{&#34;1&#34;} =&gt; []string{&ldquo;1&rdquo;} note: the &ldquo;number&rdquo; 1 becomes a string &ldquo;1&rdquo;
5) []string{&#34;0.5&#34;} =&gt; []string{&ldquo;0.5&rdquo;}
6) []string{&#34;&#34;} =&gt; []string{&ldquo;&rdquo;}
7) []string{&#34;1e3&#34;} =&gt; []string{&ldquo;1e3&rdquo;} note: not 1000
